import ReactDOM from 'react-dom';
import Nav,{Card} from "./cards";
import Arr from "./cardsarr";
const rof = () =>{
    return (<>

        <Card imgsrc={Arr[i].imgsrc} link={Arr[i].link} name={Arr[i].name}/>


    </>
    );
}
ReactDOM.render(<>
    <Nav/>
    <div className="ashu">
    Arr.map(rof);





    </div>
    </>,document.getElementById("root"));

